import React from 'react';


import SummonerBrief from '../components/SummonerBrief';
import SummonerHistory from '../components/SummonerHistory';
import { useParams } from "react-router-dom";

import RiotAPI  from '../tools/RiotAPI';



export default function Summoner(){

  let params = useParams();
  let api = new RiotAPI();
  let toReturn;

  api.fetchSummonerByName(params.summonerName)
  .then((response) => {
    //console.log(response);
    return <SummonerBrief account={response.data}/>;
  })
  .catch((error) => {
      console.log(error);
      toReturn = "<h1>error</h1>";
  });
  
  return <h1>test</h1>;

}
